import React from "react";
import "./Home";

function Home() {
  return (
    <div>
      <div className="Taddy">
        <img src="https://img.freepik.com/premium-photo/brown-teddy-bear-sitting-top-bed_1072138-69826.jpg" alt="Description of image" height= "400px"/>
      </div>
    </div>
  );
}

export default Home;
